extern int16 user_type;

static uint8 PrintBitMap[384*CODE39_FRAME_SIZE];

uint8 CT_PrintCode39(const char* pin){
	uint32 height;
	uint8 result;
	char _pin[13];

	sprintf(_pin, "*%s*", pin);

	TP_PrnSessionStart();
	height = CT_StringToCode39Bitmap(_pin, PrintBitMap);
	result = TP_PrnLogo(PrintBitMap,384,height);
	TP_PrnStep(7);
	TP_PrnSessionEnd();
	return result;
}

/* Auxiliary method of "CT_PrintReceip", print a block of information with the font especified
 * @params font_size The font's size of the text to be printed
 * @params text_to_print The text to be printed
 * @returns The exit code of the method TP_PrnString() that is the method who actually tries to print the text
 **/
uint8 CT_PrintBlock(uint8 font_size, const char* text_to_print) {
	TP_PrnFontSet(font_size);
	TP_PrnClearString();
	TP_PrnAddString((uint8*)"%s", text_to_print);
	return TP_PrnString();
}

/*Auxiliary method of "CT_PrintReceip", in a case of error closes the printing session*/
void CT_ClosePrinter(uint8 company, uint8 type) {
	if(company == CT_BIGOTT && !type){
		TP_PrnStep(2);
	}else{
		TP_PrnStep(7);
	}
	TP_PrnSessionEnd();
	TP_ScrSetIcon(ICON_PRINTER, CLOSEICON);
}

